import React from "react";

function Pageloading() {
  return (
    <div
      style={{
        display: "flex",
        minHeight: "100vh",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div>
        <h3>Loading...</h3>
      </div>
    </div>
  );
}

export default Pageloading;
